script: |
  super -f text -I q2899.spq | sort > q2899.out

inputs:
  - name: q2899.spq
    data: |
      SELECT ALL col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col2 BETWEEN - - col0 + - col1 / col0 AND - CAST ( + 8 AS INTEGER ) - 38 / + col0;
  - name: tab2

outputs:
  - name: q2899.out
    data: |
      23
      40
      58
